    ["200300104"]=setmetatable({id=200300104,leaderId=2003001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Xialuo_Main_Online",words={[1]="虽然夏洛很欣赏导师沉迷工作的样子……",[2]="但是持续劳动会让效率降低的哦？"}},mt),
    ["200300105"]=setmetatable({id=200300105,leaderId=2003001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Xialuo_Main_Login_Day",words={[1]="导师导师，从这里往下看好高啊！"}},mt),
    ["200300106"]=setmetatable({id=200300106,leaderId=2003001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Xialuo_Main_Login_DayUp",words={[1]="锵锵！被夏洛吓了一跳吧！",[2]="哎？没有？失败了啊……"}},mt),
    ["200300107"]=setmetatable({id=200300107,leaderId=2003001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Xialuo_Main_Login_Night",words={[1]="哇！夜晚的天空好美啊，夏洛触手可及！"}},mt),
    ["200300108"]=setmetatable({id=200300108,leaderId=2003001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Xialuo_Main_Login_NightUp",words={[1]="导师你来了呀，",[2]="坐在这里吹吹晚风真是难得的惬意呀。"}},mt),
    ["200300109"]=setmetatable({id=200300109,leaderId=2003001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Xialuo_Main_Talk1",words={[1]="唱歌么？",[2]="唔……啊！不可以唱！",[3]="夏洛唱歌会吸引来异生体的！"}},mt),
    ["200300110"]=setmetatable({id=200300110,leaderId=2003001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Xialuo_Main_Talk2",words={[1]="你问我为什么会留在尼伯赞歌号上？",[2]="唔，在这里可以去各种不同的地方，",[3]="还可以遇见很多有趣的人，",[4]="最重要的是，这种生活可是夏洛一直很向往的！"}},mt),
    ["200300111"]=setmetatable({id=200300111,leaderId=2003001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Xialuo_Main_Talk3",words={[1]="导师，前不久奈纳说去旅行要准备好多好多钱的，",[2]="夏洛并没有准备就跑了出来，这可怎么办呀，",[3]="不知道哪里可以抵押式杖呢……",[4]="哎？不可以么？",[5]="唔，那就只能想想别的办法了呀……"}},mt),
    ["200300112"]=setmetatable({id=200300112,leaderId=2003001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Xialuo_Main_Talk4",words={[1]="时常出现在夏洛脑海之中的声音，与其说那是歌声，倒不如说是恸哭要更贴切一些，",[2]="虽然夏洛很想立刻把这台出现故障的播放器关掉，",[3]="但果然还是应该先搞清楚发出悲鸣的究竟是什么，探索未知才是旅行的真谛嘛！"}},mt),
