    ["200400109"]=setmetatable({id=200400109,leaderId=2004001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Weila_Main_Talk1",words={[1]="战斗方式？",[2]="这可没有什么复杂的理由。",[3]="不能做到快速汇聚源能击杀敌人，就只能被敌人击杀，就是这么简单。"}},mt),
