    ["200400111"]=setmetatable({id=200400111,leaderId=2004001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Weila_Main_Talk3",words={[1]="如果有一天你了解到我的过去",[2]="也请不要流露出同情的表情。"}},mt),
