    ["200400113"]=setmetatable({id=200400113,leaderId=2004001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Weila_Main_Click_Continue",words={[1]="敌袭？！……导师，请不要搞这种恶作剧。"}},mt),
    ["200400114"]=setmetatable({id=200400114,leaderId=2004001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Weila_Main_Special",words={[1]="导师，你来的正好，晚间的训练刚刚开始，如果没有要紧的事就去参加训练吧",[2]="法尼娅她们也在那边，保持绝佳的身体素质也是十分重要的一环。"}},mt),
