    ["200500104"]=setmetatable({id=200500104,leaderId=2005001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Waxiti_Main_Online",words={[1]="稍微休息一下吧，张弛有度才是最健康的学习方法。"}},mt),
