    ["200500107"]=setmetatable({id=200500107,leaderId=2005001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Waxiti_Main_Login_Night",words={[1]="晚上好，导师。"}},mt),
    ["200500108"]=setmetatable({id=200500108,leaderId=2005001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Waxiti_Main_Login_NightUp",words={[1]="又见面了，你也很喜欢这里吗？"}},mt),
    ["200500109"]=setmetatable({id=200500109,leaderId=2005001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Waxiti_Main_Talk1",words={[1]="我知道很多，但也有很多不知道的，学无止境。"}},mt),
    ["200500110"]=setmetatable({id=200500110,leaderId=2005001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Waxiti_Main_Talk2",words={[1]="维拉小姐总是对我抱有强烈的敌意，是因为……",[2]="我不小心把她的布丁吃掉了吗？"}},mt),
    ["200500111"]=setmetatable({id=200500111,leaderId=2005001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Waxiti_Main_Talk3",words={[1]="你想从我这里知道什么呢？",[2]="关于星辰和大地，还是REVO的秘密呢？",[3]="又或者，只是关于我？"}},mt),
