    ["200900113"]=setmetatable({id=200900113,leaderId=2009001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Bai_Main_Click_Continue",words={[1]="导师？"}},mt),
    ["200900114"]=setmetatable({id=200900114,leaderId=2009001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime={[1]=14,[2]=16},priority=0.5,characterVoiceName="Vo_Bai_Main_Special",words={[1]="法尼娅说，如果导师偷懒的话，可以适当的惩罚一下。"}},mt),
    ["200900115"]=setmetatable({id=200900115,leaderId=2009001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Bai_Main_Idle1",words={[1]="瓦哈纳，暖洋洋的，",[2]="和在拉普兰时大家一起围坐在火炉边的感觉一样。"}},mt),
    ["200900116"]=setmetatable({id=200900116,leaderId=2009001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Bai_Main_Idle2",words={[1]="卡纳莉娅说，塔维尔和白之间的关系是一种“共依存”，是不好的，",[2]="可白觉得，人不互相依靠是无法生存下去的。",[3]="导师，究竟什么才是“正确”的呢？"}},mt),
    ["200900117"]=setmetatable({id=200900117,leaderId=2009001,talkInterface=1,talkType=16,aniName="Home_Yaohuangshouji_01",aniIFaceName="Home_Yaohuangshouji_01",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Bai_Main_Shake",words={[1]="白，有点晕。"}},mt),
    ["200900118"]=setmetatable({id=200900118,leaderId=2009001,talkInterface=1,talkType=17,aniName="Canteen_Idle_01",aniIFaceName="Canteen_Idle_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="",words=xlsNilTable},mt),
