    ["201000101"]=setmetatable({id=201000101,leaderId=2010001,talkInterface=1,talkType=-1,aniName="Home_Idle_01",aniIFaceName="",triggerTime=xlsNilTable,priority=0,characterVoiceName="",words=xlsNilTable},mt),
    ["201000102"]=setmetatable({id=201000102,leaderId=2010001,talkInterface=1,talkType=1,aniName="Home_Appoint_01",aniIFaceName="Home_Appoint_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Alaixiya_Main_Assistant",words={[1]="只要有本天才在，什么问题都能解决啦",[2]="",[3]="快点让外行们都停下手里的活吧。"}},mt),
    ["201000103"]=setmetatable({id=201000103,leaderId=2010001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Alaixiya_Main_Offline",words={[1]="啊？你在啊？",[2]="本天才太忙都没注意到你回来了。"}},mt),
    ["201000104"]=setmetatable({id=201000104,leaderId=2010001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Alaixiya_Main_Online",words={[1]="就算天才如我，也需要适当的休息才能提升效率……听懂了吗？",[2]="哎呀！我让你注意休息！"}},mt),
    ["201000105"]=setmetatable({id=201000105,leaderId=2010001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Alaixiya_Main_Login_Day",words={[1]="早，今天有什么计划吗？"}},mt),
    ["201000106"]=setmetatable({id=201000106,leaderId=2010001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Alaixiya_Main_Login_DayUp",words={[1]="睡醒了吗？昨晚为了处理手头的研究报告，本天才又熬了一夜。"}},mt),
    ["201000107"]=setmetatable({id=201000107,leaderId=2010001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Alaixiya_Main_Login_Night",words={[1]="晚上好，今天的事项都完成了吗？",[2]="没完成也是没办法的事情，凡人就别给自己太多压力啦。"}},mt),
    ["201000108"]=setmetatable({id=201000108,leaderId=2010001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Alaixiya_Main_Login_NightUp",words={[1]="天色不早了，有什么没有处理完的事情，",[2]="本天才勉为其难加个班帮你处理一下吧?"}},mt),
    ["201000109"]=setmetatable({id=201000109,leaderId=2010001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Alaixiya_Main_Talk1",words={[1]="符文和源能之间的联系可是很深奥的，",[2]="我已经整理出来几种假说啦，不过凡人看不懂也是很正常的吧，",[3]="毕竟是本天才费尽心思的杰作。"}},mt),
    ["201000110"]=setmetatable({id=201000110,leaderId=2010001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Alaixiya_Main_Talk2",words={[1]="符文研究其实是需要很多人力的，",[2]="不过一般人不愿意配合我吧。",[3]="喂，别用这种眼神看我！",[4]="我对自己不受欢迎这种事还是挺清楚啦。"}},mt),
    ["201000111"]=setmetatable({id=201000111,leaderId=2010001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Alaixiya_Main_Talk3",words={[1]="小橘……？叫我吗……？啊！耶拉她们又给我起外号了是吧？！"}},mt),
    ["201000112"]=setmetatable({id=201000112,leaderId=2010001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Alaixiya_Main_Talk4",words={[1]="以前做私人研究的时候，我一直都是独来独往的，",[2]="但是阐释工坊的人却总是会主动粘过来，",[3]="现在瓦哈纳的人也是，真烦人呀……",[4]="嘿嘿。"}},mt),
    ["201000113"]=setmetatable({id=201000113,leaderId=2010001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Alaixiya_Main_Click_Continue",words={[1]="干嘛？本天才可忙着呢。"}},mt),
    ["201000114"]=setmetatable({id=201000114,leaderId=2010001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Alaixiya_Main_Special",words={[1]="睡觉？这个时间段本天才灵感爆发好吗？"}},mt),
    ["201000115"]=setmetatable({id=201000115,leaderId=2010001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Alaixiya_Main_Idle1",words={[1]="东部遗迹内的符文编写习惯和西部的有很大不同，",[2]="这明显和世界树的地理位置有关联。"}},mt),
    ["201000116"]=setmetatable({id=201000116,leaderId=2010001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Alaixiya_Main_Idle2",words={[1]="只要有足够高的研究效率，多休息一会也没关系啦。"}},mt),
    ["201000117"]=setmetatable({id=201000117,leaderId=2010001,talkInterface=1,talkType=16,aniName="Home_Yaohuangshouji_01",aniIFaceName="Home_Yaohuangshouji_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Alaixiya_Main_Shake",words={[1]="先声明，",[2]="这个晃动可不是我的实验导致的。"}},mt),
    ["201000118"]=setmetatable({id=201000118,leaderId=2010001,talkInterface=1,talkType=17,aniName="Canteen_Idle_01",aniIFaceName="Canteen_Idle_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="",words=xlsNilTable},mt),
    ["201000119"]=setmetatable({id=201000119,leaderId=2010001,talkInterface=1,talkType=18,aniName="Canteen_Talk_01",aniIFaceName="Canteen_Talk_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Alaixiya_Other_Party",words={[1]="在尼伯赞歌也是大家聚在一起吃饭吗？嗯……不错的设计。"}},mt),
    ["201000120"]=setmetatable({id=201000120,leaderId=2010001,talkInterface=1,talkType=19,aniName="Canteen_Talk_02",aniIFaceName="Canteen_Talk_02",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Alaixiya_Other_PartyFriend",words={[1]="想不到导师这种原始人也懂美食啊，不过还差得远呢，本天才就勉为其难抽出两个小时的时间给你讲解一下大陆各地的儿童套餐之间的区别与渊源吧。"}},mt),
