    ["201100102"]=setmetatable({id=201100102,leaderId=2011001,talkInterface=1,talkType=1,aniName="Home_Appoint_01",aniIFaceName="Home_Appoint_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Geweidelin_Main_Assistant",words={[1]="正好，我也想体验一下蕾跟在我身边时的感受。"}},mt),
    ["201100103"]=setmetatable({id=201100103,leaderId=2011001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Geweidelin_Main_Offline",words={[1]="每个人在其他人的生命中都只是过客，",[2]="但也正是因此，相遇才显得弥足珍贵。",[3]="能再次与你同行，我很荣幸。"}},mt),
    ["201100104"]=setmetatable({id=201100104,leaderId=2011001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Geweidelin_Main_Online",words={[1]="适度的放松能让剑刃触及的范围更广。"}},mt),
    ["201100105"]=setmetatable({id=201100105,leaderId=2011001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Geweidelin_Main_Login_Day",words={[1]="导师，你来了。",[2]="开始今天的工作吧。"}},mt),
    ["201100106"]=setmetatable({id=201100106,leaderId=2011001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Geweidelin_Main_Login_DayUp",words={[1]="正好想到关于你的事，你就过来了。"}},mt),
    ["201100107"]=setmetatable({id=201100107,leaderId=2011001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Geweidelin_Main_Login_Night",words={[1]="还有没完成的工作吗？"}},mt),
    ["201100108"]=setmetatable({id=201100108,leaderId=2011001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Geweidelin_Main_Login_NightUp",words={[1]="夜晚是“它”最活跃的时间，现在的我可能会被盯上，保持警惕。"}},mt),
    ["201100109"]=setmetatable({id=201100109,leaderId=2011001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Geweidelin_Main_Talk1",words={[1]="如果有什么困难，就尽管借用我的力量吧，",[2]="毕竟这就是我存在的意义。"}},mt),
    ["201100110"]=setmetatable({id=201100110,leaderId=2011001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Geweidelin_Main_Talk2",words={[1]="别被问题复杂的表象迷惑，",[2]="打了死结的线团，直接斩断就好。"}},mt),
    ["201100111"]=setmetatable({id=201100111,leaderId=2011001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Geweidelin_Main_Talk3",words={[1]="距离感……",[2]="蕾也经常这么说我，可我觉得我和其他人相处的还不错……",[3]="难道是我的错觉吗？"}},mt),
    ["201100112"]=setmetatable({id=201100112,leaderId=2011001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Geweidelin_Main_Talk4",words={[1]="简单、纯粹，故而“绝对”，",[2]="那是我所追求的，也是我必须面对的。"}},mt),
    ["201100113"]=setmetatable({id=201100113,leaderId=2011001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Geweidelin_Main_Click_Continue",words={[1]="我更喜欢简单直接的交流方式。"}},mt),
