    ["201300110"]=setmetatable({id=201300110,leaderId=2013001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Lei_Main_Talk2",words={[1]="虽然格薇德林大人的功勋令人敬佩，可是在这个时代，",[2]="战斗……真的还有意义吗？"}},mt),
