    ["201300115"]=setmetatable({id=201300115,leaderId=2013001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Lei_Main_Idle1",words={[1]="喂，你在发呆吗？"}},mt),
    ["201300116"]=setmetatable({id=201300116,leaderId=2013001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Lei_Main_Idle2",words={[1]="导师，其实我对你的经历有点好奇，",[2]="能和我说说你过去的事吗？"}},mt),
