    ["201400102"]=setmetatable({id=201400102,leaderId=2014001,talkInterface=1,talkType=1,aniName="Home_Appoint_01",aniIFaceName="Home_Appoint_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Guimo_Main_Assistant",words={[1]="选择了我吗，万分感谢。",[2]="那么，就让我来听一听你要讲述的故事吧，",[3]="作为等价交换，我也会毫不吝啬地讲述我的故事。"}},mt),
    ["201400103"]=setmetatable({id=201400103,leaderId=2014001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Guimo_Main_Offline",words={[1]="被遗忘之人终于回归……",[2]="哦？",[3]="你可以猜一猜，“被遗忘之人”到底是你，还是我呢？"}},mt),
