    ["201400105"]=setmetatable({id=201400105,leaderId=2014001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Guimo_Main_Login_Day",words={[1]="嘘，还差一点儿就凝聚成功了……",[2]="好了，完成。"}},mt),
    ["201400106"]=setmetatable({id=201400106,leaderId=2014001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Guimo_Main_Login_DayUp",words={[1]="我给你变个戏法吧，看好了。呼，燃烧吧，尼伯赞歌号！",[2]="呵呵，骗你的，偶尔想这样玩一次。"}},mt),
    ["201400107"]=setmetatable({id=201400107,leaderId=2014001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Guimo_Main_Login_Night",words={[1]="倘若真的手可摘星辰该多好啊……"}},mt),
    ["201400108"]=setmetatable({id=201400108,leaderId=2014001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Guimo_Main_Login_NightUp",words={[1]="在极夜之地，星辰的明晦是时间感知的参照，记住它们的所在，别迷失了航向。"}},mt),
    ["201400109"]=setmetatable({id=201400109,leaderId=2014001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Guimo_Main_Talk1",words={[1]="文献馆里发光的石板我可以拿走一块吗？",[2]="不能？那真是可惜了。"}},mt),
    ["201400110"]=setmetatable({id=201400110,leaderId=2014001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Guimo_Main_Talk2",words={[1]="……昨夜的晚餐，加了很多胡萝卜和生菜，导师，这不是你的恶作剧吧？",[2]="我已经是大人了，这些蔬菜还是留给孩子们吧。"}},mt),
    ["201400111"]=setmetatable({id=201400111,leaderId=2014001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Guimo_Main_Talk3",words={[1]="相比较于第一盏茶的苦和第二盏茶的甜，",[2]="我更喜欢第三盏茶的平淡，",[3]="能够稀释狂躁的血液，让我静下心来，",[4]="你要尝一尝吗？"}},mt),
    ["201400112"]=setmetatable({id=201400112,leaderId=2014001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Guimo_Main_Talk4",words={[1]="不知道顾途有没有顺利完成任务……",[2]="啊，我不是担心她，她比我要强得多，无论怎样的敌人都能够轻松解决，",[3]="只是在做任务的时候，她总是会溜去酒馆，",[4]="偶尔还会忘记任务的期限，导致任务失败。",[5]="这一点让许多成员都有些头疼啊，哈哈。"}},mt),
    ["201400113"]=setmetatable({id=201400113,leaderId=2014001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Guimo_Main_Click_Continue",words={[1]="嘶，我很怕痒的，请不要这样。"}},mt),
