    ["201500102"]=setmetatable({id=201500102,leaderId=2015001,talkInterface=1,talkType=1,aniName="Home_Appoint_01",aniIFaceName="Home_Appoint_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Heerwei_Main_Assistant",words={[1]="你找我吗？",[2]="先说清楚，我可没那么多空闲时间出来闲逛。但是……偶尔陪你聊聊天也不是不行。"}},mt),
    ["201500103"]=setmetatable({id=201500103,leaderId=2015001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Heerwei_Main_Offline",words={[1]="你这家伙还知道回来啊？",[2]="……不，我是说，你让我等了很久啊。"}},mt),
    ["201500104"]=setmetatable({id=201500104,leaderId=2015001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Heerwei_Main_Online",words={[1]="如果这个时间没法想明白这些事，为什么不休息一下再来思考呢？"}},mt),
    ["201500105"]=setmetatable({id=201500105,leaderId=2015001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Heerwei_Main_Login_Day",words={[1]="准备好了的话，就出发吧，",[2]="不要想着偷懒哦！"}},mt),
    ["201500106"]=setmetatable({id=201500106,leaderId=2015001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Heerwei_Main_Login_DayUp",words={[1]="导师，你来的时候有看到椿那家伙吗？",[2]="揍她？",[3]="不，我只是要让她把我水杯里的那堆东西，全部，一滴不剩地喝完。"}},mt),
    ["201500107"]=setmetatable({id=201500107,leaderId=2015001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Heerwei_Main_Login_Night",words={[1]="呜哇！别过来！！……",[2]="哎？是导师啊，",[3]="可，可以把那边的灯打开吗？"}},mt),
    ["201500108"]=setmetatable({id=201500108,leaderId=2015001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Heerwei_Main_Login_NightUp",words={[1]="导师，可以再靠近一点吗？我稍微有点，不太适应这种黑暗的环境……",[2]="光线，有点太暗了。"}},mt),
    ["201500109"]=setmetatable({id=201500109,leaderId=2015001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Heerwei_Main_Talk1",words={[1]="肮脏的生物是不可信的……",[2]="对，对不起，我又说出了这种词！呜……"}},mt),
    ["201500110"]=setmetatable({id=201500110,leaderId=2015001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Heerwei_Main_Talk2",words={[1]="导师，如果看到椿了，可以转告她吗？",[2]="“我不小心把芦荟汁打翻在她的被子上了，真是不好意思呢”。"}},mt),
    ["201500111"]=setmetatable({id=201500111,leaderId=2015001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Heerwei_Main_Talk3",words={[1]="南方制造有很多队伍，天车只是其中的一支，据我所知的成员就有五位，虽然……",[2]="咦？你的表情怎么……",[3]="她们没有告诉你还有一位成员吗？！"}},mt),
    ["201500112"]=setmetatable({id=201500112,leaderId=2015001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Heerwei_Main_Talk4",words={[1]="椿她……从来不肯讲自己的事，但是她千方百计想要遮挡起来的痕迹足以说明她经历了什么。",[2]="导师，如果有机会了解到她的过去，能否代替我给她一个拥抱？……",[3]="我为什么不自己去？",[4]="这，这种事想想也没可能的吧，我见到那个家伙只想一棍子敲晕她！"}},mt),
    ["201500113"]=setmetatable({id=201500113,leaderId=2015001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Heerwei_Main_Click_Continue",words={[1]="你最好有重要的事情要跟我说……"}},mt),
    ["201500114"]=setmetatable({id=201500114,leaderId=2015001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime={[1]=14,[2]=16},priority=0.5,characterVoiceName="Vo_Heerwei_Main_Special",words={[1]="早啊导师，早起锻炼已经是我的一种习惯了，你也有这种习惯吗？",[2]="那，以后要相约一起去锻炼身体吗？"}},mt),
    ["201500115"]=setmetatable({id=201500115,leaderId=2015001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Heerwei_Main_Idle1",words={[1]="你这是在做什么，假扮木头吗？",[2]="哼，真可笑。"}},mt),
    ["201500116"]=setmetatable({id=201500116,leaderId=2015001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Heerwei_Main_Idle2",words={[1]="导师你是又从椿那里学习了什么戏弄我的法子吗？我可不会上当的！"}},mt),
    ["201500117"]=setmetatable({id=201500117,leaderId=2015001,talkInterface=1,talkType=16,aniName="Home_Yaohuangshouji_01",aniIFaceName="Home_Yaohuangshouji_01",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Heerwei_Main_Shake",words={[1]="呜哇啊！是椿在捣鬼吗？！"}},mt),
