    ["201600101"]=setmetatable({id=201600101,leaderId=2016001,talkInterface=1,talkType=-1,aniName="Home_Idle_01",aniIFaceName="",triggerTime=xlsNilTable,priority=0,characterVoiceName="",words=xlsNilTable},mt),
    ["201600102"]=setmetatable({id=201600102,leaderId=2016001,talkInterface=1,talkType=1,aniName="Home_Appoint_01",aniIFaceName="Home_Appoint_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Chun_Main_Assistant",words={[1]="哟！导师！你要和我学习怎么制作整蛊道具吗？",[2]="没问题没问题，交给我，包会！",[3]="以后我们就是“同伴”了！"}},mt),
    ["201600103"]=setmetatable({id=201600103,leaderId=2016001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Chun_Main_Offline",words={[1]="嗯？呜哇啊啊啊！有鬼啊！！！哎？",[2]="等等，有腿，你真的是导师本人啊？"}},mt),
    ["201600104"]=setmetatable({id=201600104,leaderId=2016001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Chun_Main_Online",words={[1]="……你这股认真的劲，真可怕呀。"}},mt),
    ["201600105"]=setmetatable({id=201600105,leaderId=2016001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Chun_Main_Login_Day",words={[1]="小心脚下！",[2]="……哈哈哈哈哈骗你的！你生气的样子实在太好玩了。"}},mt),
    ["201600106"]=setmetatable({id=201600106,leaderId=2016001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Chun_Main_Login_DayUp",words={[1]="导师你看到赫尔薇气急败坏的脸了吗哈哈哈哈……",[2]="呜哇！她过来了！导师你快帮我挡一下！",[3]="……呼，还好没被她发现。"}},mt),
    ["201600107"]=setmetatable({id=201600107,leaderId=2016001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Chun_Main_Login_Night",words={[1]="导师！跟在你身后的那个人是谁啊？！",[2]="……噗，哈哈，哈哈哈哈，你的表情，太好笑了，哈哈哈。"}},mt),
    ["201600108"]=setmetatable({id=201600108,leaderId=2016001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Chun_Main_Login_NightUp",words={[1]="天干物燥，小心火烛……哇着火了着火了！",[2]="……才怪！哈哈哈！"}},mt),
    ["201600109"]=setmetatable({id=201600109,leaderId=2016001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Chun_Main_Talk1",words={[1]="不要试图揭开我的面具，这里寄宿了某种诅咒，",[2]="一旦揭开就会附着到你的身上，然后你也会和我一样变得丑陋……",[3]="不行了，哈哈哈哈逗你玩的！"}},mt),
    ["201600110"]=setmetatable({id=201600110,leaderId=2016001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Chun_Main_Talk2",words={[1]="屏气凝神！去感受空气的流动，慢慢地，将注意力集中在你的目标上，",[2]="对，就像这样，保持住……",[3]="噗，你是不是忘记呼吸了，脸都憋红了哈哈哈哈哈。"}},mt),
    ["201600111"]=setmetatable({id=201600111,leaderId=2016001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Chun_Main_Talk3",words={[1]="不做恶作剧的话会失去很多乐趣的，",[2]="你也这样认为的吧，不然怎么会来找我呢，对吧。"}},mt),
    ["201600112"]=setmetatable({id=201600112,leaderId=2016001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Chun_Main_Talk4",words={[1]="赫尔薇是不是找到新的有意思的东西了，",[2]="最近对我的恶作剧都无动于衷，",[3]="还露出一副怜惜的表情……好在意，十分在意……",[4]="不行了，导师你快帮我打探一下。……哈哈哈哈逗你玩的！"}},mt),
    ["201600113"]=setmetatable({id=201600113,leaderId=2016001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Chun_Main_Click_Continue",words={[1]="不许敲我！我才不是小矮子！"}},mt),
    ["201600114"]=setmetatable({id=201600114,leaderId=2016001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime={[1]=14,[2]=16},priority=0.5,characterVoiceName="Vo_Chun_Main_Special",words={[1]="导师？！你也是来偷看赫尔薇出糗的吗？来来来，这里是个绝佳的好位置……",[2]="噗哈哈哈哈，快看她，太好玩了！哈哈哈哈！"}},mt),
    ["201600115"]=setmetatable({id=201600115,leaderId=2016001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Chun_Main_Idle1",words={[1]="不觉得干站着有些无聊吗？你再不说话，我就去找赫尔薇咯……",[2]="导师？"}},mt),
    ["201600116"]=setmetatable({id=201600116,leaderId=2016001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Chun_Main_Idle2",words={[1]="咦？那边天上飘着的是什么？哇！导师快看那边！好大一只异生体！",[2]="……这样都没反应啊？真无聊。"}},mt),
