    ["201700103"]=setmetatable({id=201700103,leaderId=2017001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Shanduola_Main_Offline",words={[1]="好久不见，导师，",[2]="大家……",[3]="都很想你。"}},mt),
