    ["201700105"]=setmetatable({id=201700105,leaderId=2017001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Shanduola_Main_Login_Day",words={[1]="导师，你好。"}},mt),
    ["201700106"]=setmetatable({id=201700106,leaderId=2017001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime={[1]=4,[2]=18},priority=1,characterVoiceName="Vo_Shanduola_Main_Login_DayUp",words={[1]="导师，",[2]="今天要做的工作已经整理好了。"}},mt),
    ["201700107"]=setmetatable({id=201700107,leaderId=2017001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Shanduola_Main_Login_Night",words={[1]="导师，夜安。"}},mt),
    ["201700108"]=setmetatable({id=201700108,leaderId=2017001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},priority=1,characterVoiceName="Vo_Shanduola_Main_Login_NightUp",words={[1]="导师，你也睡不着吗？"}},mt),
    ["201700109"]=setmetatable({id=201700109,leaderId=2017001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Shanduola_Main_Talk1",words={[1]="眼睛吗……",[2]="喜欢中夹杂着厌恶吧，",[3]="那时我选择了和艾德娜不一样的道路，",[4]="从这一点来看，大概……",[5]="是厌恶多一些。"}},mt),
    ["201700110"]=setmetatable({id=201700110,leaderId=2017001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Shanduola_Main_Talk2",words={[1]="拉普兰……",[2]="那里的人们都是好人，",[3]="他们始终坚持着自己的生存方式并为之感到骄傲，",[4]="或许……这就是真正的‘强大’吧。"}},mt),
    ["201700111"]=setmetatable({id=201700111,leaderId=2017001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Shanduola_Main_Talk3",words={[1]="你问这个？",[2]="是老师给我的，艾德娜也有一个差不多的，",[3]="看起来是支笔，但实际上",[4]="根本不能用来写字……",[5]="嗯，这种奇奇怪怪的东西确实很像她的风格。"}},mt),
    ["201700112"]=setmetatable({id=201700112,leaderId=2017001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Shanduola_Main_Talk4",words={[1]="年龄？",[2]="当然是白姐姐大一些，不过……",[3]="仔细想想，第一次遇到白姐姐的时候，我和艾德娜只到她的肩膀，现在已经跟她差不多了，",[4]="说不定再过一段时间……"}},mt),
    ["201700113"]=setmetatable({id=201700113,leaderId=2017001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Shanduola_Main_Click_Continue",words={[1]="嗯？导师？"}},mt),
    ["201700114"]=setmetatable({id=201700114,leaderId=2017001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime={[1]=14,[2]=16},priority=0.5,characterVoiceName="Vo_Shanduola_Main_Special",words={[1]="我很喜欢晚上，",[2]="视野被深蓝的夜空填满时，会有一种奇妙的安全感。"}},mt),
    ["201700115"]=setmetatable({id=201700115,leaderId=2017001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Shanduola_Main_Idle1",words={[1]="奈瑟米尔……",[2]="爷爷那时究竟是出于怎样的心理，",[3]="才会给我和艾德娜取了这个姓氏呢……"}},mt),
    ["201700116"]=setmetatable({id=201700116,leaderId=2017001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Shanduola_Main_Idle2",words={[1]="昨天做了一个噩梦，梦到艾德娜去了很远很远的地方，",[2]="我怎么追都追不上她……"}},mt),
    ["201700117"]=setmetatable({id=201700117,leaderId=2017001,talkInterface=1,talkType=16,aniName="Home_Yaohuangshouji_01",aniIFaceName="Home_Yaohuangshouji_01",triggerTime=xlsNilTable,priority=0.2,characterVoiceName="Vo_Shanduola_Main_Shake",words={[1]="唔……塔维尔，要尝尝这个吗？",[2]="导师，恶作剧是不对的……"}},mt),
