    ["202400102"]=setmetatable({id=202400102,leaderId=2024001,talkInterface=1,talkType=1,aniName="Home_Appoint_01",aniIFaceName="Home_Appoint_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Aoli_Main_Assistant",words={[1]="我来啦我来啦！嘿嘿。"}},mt),
    ["202400103"]=setmetatable({id=202400103,leaderId=2024001,talkInterface=1,talkType=2,aniName="Home_ChangshijianDengluwenhou_01",aniIFaceName="Home_ChangshijianDengluwenhou_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Aoli_Main_Offline",words={[1]="啊……哈啊！老大！你一定带了很多有趣的东西回来吧！",[2]="快给我看看，给我看看！"}},mt),
    ["202400104"]=setmetatable({id=202400104,leaderId=2024001,talkInterface=1,talkType=3,aniName="Home_Changshijianyouwan_01",aniIFaceName="Home_Changshijianyouwan_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Aoli_Main_Online",words={[1]="老大，你，真的，不要，休息一下，么？",[2]="我，我的头，好晕。唔姆姆——呀嘿！"}},mt),
    ["202400105"]=setmetatable({id=202400105,leaderId=2024001,talkInterface=1,talkType=4,aniName="Home_DengluwenhouBaitian_01",aniIFaceName="Home_DengluwenhouBaitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Aoli_Main_Login_Day",words={[1]="哦！老大你来啦！"}},mt),
    ["202400106"]=setmetatable({id=202400106,leaderId=2024001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Aoli_Main_Login_DayUp",words={[1]="哦！老大你终于来啦！"}},mt),
    ["202400107"]=setmetatable({id=202400107,leaderId=2024001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Aoli_Main_Login_Night",words={[1]="夜生活，开始咯！",[2]="要出去活动活动身体吗，老大？"}},mt),
    ["202400108"]=setmetatable({id=202400108,leaderId=2024001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Aoli_Main_Login_NightUp",words={[1]="出去玩吗？出去玩吧老大！",[2]="这种时间就应该出去玩才对啊！"}},mt),
    ["202400109"]=setmetatable({id=202400109,leaderId=2024001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Aoli_Main_Talk1",words={[1]="哎~有什么想做的事情就去做嘛，大不了把知情者统统干掉不就好了。",[2]="什么？不可以吗？但是斯娜弗尔就是这样做的呀……唔嗯……？"}},mt),
    ["202400110"]=setmetatable({id=202400110,leaderId=2024001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Aoli_Main_Talk2",words={[1]="你是老大，我当然听你的！除了斯娜弗尔，剔骨，康斯坦丁……",[2]="除了她们以外，我当然听你的！"}},mt),
    ["202400111"]=setmetatable({id=202400111,leaderId=2024001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Aoli_Main_Talk3",words={[1]="她们说只有把这群坏东西撕得粉碎，这些坏东西才不会继续祸害我们。",[2]="这样不对吗？咦？太残暴？这种事情我不懂哎——你教教我吧！"}},mt),
    ["202400112"]=setmetatable({id=202400112,leaderId=2024001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Aoli_Main_Talk4",words={[1]="老，老大，你有没有心跳加快，大脑空白，身边的空气都变热了一样的感觉？",[2]="我好像，现在，有一点……唔……",[3]="在剔骨身边的时候也会这样，是生病了么？果然是我平时运动量不足，得加大训练量才行！"}},mt),
    ["202400113"]=setmetatable({id=202400113,leaderId=2024001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Aoli_Main_Click_Continue",words={[1]="嗯？"}},mt),
    ["202400114"]=setmetatable({id=202400114,leaderId=2024001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Aoli_Main_Special",words={[1]="姆——哈，老大，感受到美好早晨的清新空气了么？",[2]="是不是很舒适很温和很健康！很适合运动！哈哈哈哈！"}},mt),
    ["202400115"]=setmetatable({id=202400115,leaderId=2024001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Aoli_Main_Idle1",words={[1]="一停下来就想睡觉，老大，我可以去睡一会儿吗？"}},mt),
    ["202400116"]=setmetatable({id=202400116,leaderId=2024001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Aoli_Main_Idle2",words={[1]="嗯，想出去啊，我现在偷偷溜走老大也不会发现的吧。",[2]="嘛，还是算了。"}},mt),
