    ["202500106"]=setmetatable({id=202500106,leaderId=2025001,talkInterface=1,talkType=5,aniName="Home_DengluwenhouBaitian_02",aniIFaceName="Home_DengluwenhouBaitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Jialifu_Main_Login_DayUp",words={[1]="导师？！",[2]="你来的正好，快来帮我看看哪个色号和今天的我更搭，",[3]="有些难以抉择呢。"}},mt),
    ["202500107"]=setmetatable({id=202500107,leaderId=2025001,talkInterface=1,talkType=6,aniName="Home_DengluwenhouHeitian_01",aniIFaceName="Home_DengluwenhouHeitian_01",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Jialifu_Main_Login_Night",words={[1]="就算是晚上也要保持最美的样子，这才是我……好了。"}},mt),
    ["202500108"]=setmetatable({id=202500108,leaderId=2025001,talkInterface=1,talkType=7,aniName="Home_DengluwenhouHeitian_02",aniIFaceName="Home_DengluwenhouHeitian_02",triggerTime=xlsNilTable,priority=0.5,characterVoiceName="Vo_Jialifu_Main_Login_NightUp",words={[1]="你来的时候有看到我最新款的那支口红吗？",[2]="突然找不到放在哪里了……",[3]="啊！在这里！"}},mt),
    ["202500109"]=setmetatable({id=202500109,leaderId=2025001,talkInterface=1,talkType=8,aniName="Home_Jiaotan_01",aniIFaceName="Home_Jiaotan_01",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Jialifu_Main_Talk1",words={[1]="你知道越野社的标语是什么吗？",[2]="噗噗！答错啦！是勇气，勇气哦！",[3]="嗯？不要摆出一副难以置信的表情啊！"}},mt),
    ["202500110"]=setmetatable({id=202500110,leaderId=2025001,talkInterface=1,talkType=9,aniName="Home_Jiaotan_02",aniIFaceName="Home_Jiaotan_02",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Jialifu_Main_Talk2",words={[1]="材质是什么并不重要，重要的是视觉效果，",[2]="这就是“加利福时尚”。"}},mt),
    ["202500111"]=setmetatable({id=202500111,leaderId=2025001,talkInterface=1,talkType=10,aniName="Home_Jiaotan_03",aniIFaceName="Home_Jiaotan_03",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Jialifu_Main_Talk3",words={[1]="越野社有几个很疯的家伙，",[2]="建议你最好不要和她们有太深入的交流，不然……"}},mt),
    ["202500112"]=setmetatable({id=202500112,leaderId=2025001,talkInterface=1,talkType=11,aniName="Home_Jiaotan_04",aniIFaceName="Home_Jiaotan_04",triggerTime=xlsNilTable,priority=0.1,characterVoiceName="Vo_Jialifu_Main_Talk4",words={[1]="越野社每个人都是非常独立的个体，",[2]="虽然斯娜弗尔是我的小姨，但我也不知道她到底是个怎样的人，",[3]="很神秘很酷对吧！"}},mt),
    ["202500113"]=setmetatable({id=202500113,leaderId=2025001,talkInterface=1,talkType=12,aniName="Home_Kuaisudianji_01",aniIFaceName="Home_Kuaisudianji_01",triggerTime=xlsNilTable,priority=1,characterVoiceName="Vo_Jialifu_Main_Click_Continue",words={[1]="啊！停！停下！你不许再靠近了！"}},mt),
    ["202500114"]=setmetatable({id=202500114,leaderId=2025001,talkInterface=1,talkType=13,aniName="Home_Tedingshijianwenhou_01",aniIFaceName="Home_Tedingshijianwenhou_01",triggerTime=xlsNilTable,priority=0.6,characterVoiceName="Vo_Jialifu_Main_Special",words={[1]="呼，还好这里的打光不是死亡打光。",[2]="嗯？我看起来没有什么奇怪的地方吧？"}},mt),
    ["202500115"]=setmetatable({id=202500115,leaderId=2025001,talkInterface=1,talkType=14,aniName="Home_Xiuxian_01",aniIFaceName="Home_Xiuxian_01",triggerTime=xlsNilTable,priority=0.4,characterVoiceName="Vo_Jialifu_Main_Idle1",words={[1]="最近是不是新出了一款香水？",[2]="不知道会不会适合导师呢，哼哼。"}},mt),
    ["202500116"]=setmetatable({id=202500116,leaderId=2025001,talkInterface=1,talkType=15,aniName="Home_Xiuxian_02",aniIFaceName="Home_Xiuxian_02",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Jialifu_Main_Idle2",words={[1]="这幅面具下到底是怎样的面容，我偷偷看一眼也没关系吧？",[2]="呜哇！开玩笑的！不会偷看的！"}},mt),
    ["202500117"]=setmetatable({id=202500117,leaderId=2025001,talkInterface=1,talkType=16,aniName="Home_Yaohuangshouji_01",aniIFaceName="Home_Yaohuangshouji_01",triggerTime=xlsNilTable,priority=0.3,characterVoiceName="Vo_Jialifu_Main_Shake",words={[1]="喂喂，小心一点。"}},mt),
